import React, { useState, useContext } from "react";
import './Login.css'

const Login = ({ dark = false }) => {
  const backgroundColor = dark ? "#424242" : "#F2EEEE";
  return <div className="login-wrapper" style={{backgroundColor: backgroundColor}}>
    <h1> Welcome back!! </h1>
  </div>;
};

export default Login;
